import React from "react";

function Table() {
  const arr = [
    {
      stock: "32 in Stock",
      price: "$ 45.99",
      sales: "20",
      name: "shivam",
      para: "lorem",
      image: "photo",
    },
    {
      stock: "32 in Stock",
      price: "$ 45.99",
      sales: "20",
      name: "manish",
      para: "lorem",
      image: "photo",
    },
  ];

  return (
    <div>
      <table>
        <tr className="tablerow">
          <th>Product Name </th>
          <div className="product">
            {" "}
            <th>Stock</th>
            <th>Price</th>
            <th>Total sales</th>
          </div>
        </tr>
        <hr />
        {arr.map((el, key) => (
          <tr className="tablerow">
            <td>{el.image}</td>
            <div className="product">
              {" "}
              <td>{el.stock}</td>
              <td>{el.price}</td>
              <td>{el.sales}</td>
            </div>
          </tr>
        ))}
      </table>
    </div>
  );
}

export default Table;
